import React, { Component } from 'react';
import {connect} from "react-redux"
import "bootstrap/dist/css/bootstrap.min.css"
class Inputdata extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <div>
                <h1>
                   RESULT <span className="fa fa-arrow-right"></span> {this.props.inputval}
                </h1>
            </div>
         );
    }
}
const mapStateToProps =(store)=>{
    return{           
       products: store.products,
       searching:store.searching,
       status:store.status,
       filteredSuggestions: store.filteredSuggestions,
       suggestions: store.suggestions,
       showSuggestions: store.showSuggestions,
       inputval: store.inputval
     }
  } 
export default connect(mapStateToProps)(Inputdata);
